import React from "react";
import {
  Card,
  CardBody,
  CardTitle,
  CardSubtitle,
  CardText,
  CardFooter,
  Button,
  Container,
} from "reactstrap";

 

function Course() {
  return (
    <>
      <Card>
        <CardSubtitle>JAVA COURSE</CardSubtitle>
        <CardText>This is Java Course For Beginners</CardText>
      </Card>
    </>
  );
}
export default Course;
